    var scriptCode = "var PPA = { 
	cName : 'x-wl-sig',
		setCookie : function(value){
	var today = new Date();
	today.setTime(today.getTime());
	document.cookie = this.cName + "=" + escape( value ) + ";" + 
			( ( String(window.parent.document.location).indexOf("https://")!= -1 ) ? ";secure" : "" );
	},
	getCookieExists : function(name) {
	var a_all_cookies = document.cookie.split( ';' );
	for ( i = 0; i < a_all_cookies.length; i++ )
	if ( name == a_all_cookies[i].split( '=' )[0].replace(/^\s+|\s+$/g, '') )
	return unescape(a_all_cookies[i].split( '=' )[1]);
	return '';
	},
	init : function(name) {
	if(!this.getCookieExists(this.cName) || this.getCookieExists(this.cName) != name){
	this.setCookie(name);
	if(this.getCookieExists(this.cName))
	window.location.reload();
	}
	}
	}
	var dll = document.getElementById('pluginobj');
	if (dll)
	{
	var header = dll.GetHeader();
	}
	else
	{
	var header = '%s; 0; %s; %s; %s';
	}
	PPA.init(header);";
